export default class Radio extends Component {

    state = {
        bool: true
    }


    render() {
        return (
            <div>

                <input type="radio" value="1"  checked={this.bool} />
                <label htmlFor="">Yes</label>
                <input type="radio" value="1" checked={this.no} />
                <label htmlFor="">No</label>
                
            </div>
        )
    }
}
